import React from 'react'
import {
    Nav,
    NavLink,
    Bars,
    NavMenu,
    NavBtn,
    NavBtnLink
  } from './NavbarElement';
function Navbar(props) {
    return (
        <Nav>
            <NavLink to='/'>
                Shopping cart
            </NavLink>
            <Bars />
          <NavLink to='/' activeStyle>
            Cart  
          {props.countCartItems ? (<button className="badge">{props.countCartItems}</button>) : 
          (<button className="badge">0</button>)
          }
          </NavLink>
        </Nav>
    )
}

export default Navbar
